import React from "react";
import { Card as CardBS } from "react-bootstrap";

const Card = () => {
	return (
		<CardBS style={{ width: "18rem" }}>
			<CardBS.Img variant="top" src="holder.js/100px180" />
			<CardBS.Body>
				<CardBS.Title>CardBS Title</CardBS.Title>
				<CardBS.Text>
					Some quick example text to build on the CardBS title and make up the
					bulk of the CardBS's content.
				</CardBS.Text>
			</CardBS.Body>
		</CardBS>
	);
};

export default Card;
